import React from "react";

export default function NominationsList(props) {
  return (
    <>
      <p>Search Results</p>
      <ul>
        {!props.movieError ? (
          props.results.map((movie) => (
            <li>
              {movie.Title}, {movie.Year}
            </li>
          ))
        ) : (
          <p>movie not found</p>
        )}
      </ul>
    </>
  );
}
